#!/usr/bin/env python# -*- coding:utf-8 -*-# @Time : 2024/7/2# @Author : cyq# @File : jacoco# @Software: PyCharm# @Desc:from pydantic import BaseModel, validator, Fieldfrom app.schema.baseSchema import BaseSchemaclass JacocoConfigSave(BaseModel):    creator: int = Field(..., description="创建人ID")    project_name: str = Field(..., max_length=200)    nowVersion: str = Field(..., max_length=100)    gitUrl: str = Field(..., max_length=100)    ip: str = Field(..., max_length=20)    ftp_url: str    project_name_list: str    project_jar_name_list: str    baseVersion: str | None = None    wx_key: str | None = None    agent_port: int | None = Field(default=None, lt=65535, gt=0)    @validator("project_name", 'nowVersion', 'gitUrl', 'ip', 'ftp_url', 'project_name_list', 'project_jar_name_list')    def not_empty(cls, v):        return BaseSchema.not_empty(v)